    false,nt"url": null,nt"notes": "This narrative report for Wheeler NWR outlines
    Refuge accomplishments from September through December of 1956. The report begins
    by summarizing the weather conditions, water conditions, and food and cover during
    this period. Wildlife- including migratory birds, upland game birds, big game animals,
    furbearers, predators, mammals, raptors, fish, and disease- is also covered. The
    Refuge development and maintenance section discusses physical developments, plantings,
    collections and receipts, and vegetation control. Resource management is outlined;
    topics include grazing, haying, fur harvesting, and timber removal. A progress report
    on field investigations and applied research is also provided. The public relations
    section of the report describes recreational uses, Refuge visitors, Refuge participation,
    hunting, fishing, and violations. Items of interest and N-R forms are attached.",nt"license_title":
